Kyōsuke Kōsaka, un estudiante de instituto normal y corriente de 17 años que vive en Chiba,[1] no se ha llevado bien con su hermana pequeña Kirino en años. Por más que intente recordar, Kirino siempre lo ha ignorado y mirado con rechazo. Parecía que la relación entre Kyōsuke y su hermana, de 14 años, continuaría así para siempre. Sin embargo, un día, Kyōsuke encuentra una carátula de DVD de un anime de magical girls llamado Hoshikuzu Witch Meruru (星くず☆うぃっちメルル, 'Hoshikuzu Witch Meruru'? Stardust Witch Meruru) el cual estaba tirado en la entrada de su casa. Para la sorpresa de Kyōsuke, dentro de la carátula había escondido un videojuego para adultos llamado Imōto to Koishiyo! (妹と恋しよっ♪, 'Imōto to Koishiyo!'? Love With Little Sister!). Kyōsuke intenta averiguar quién es el culpable al que se le cayó el DVD sacando el tema de las magical girls durante la cena. Todo lo que consigue es una fuerte negativa de sus padres, especialmente de su padre, un policía anti-otaku.
Esa noche, Kirino entra en la habitación de Kyōsuke y, a pesar de ser la primera conversación que tienen en años, dice que &quot;tienen cosas de las que hablar&quot;. Kirino lleva a Kyōsuke a su habitación y le enseña una gran colección de anime y de juegos eroge que ha estado coleccionando en secreto.&nbsp;

