Iku siempre se ha apoyado en su hermano, y ahora no entiende por que la trata diferente. Yori desde pequeño había sentido mucha adoración por su hermana, al igual que ella por él. Pero Yori se dió cuenta de que esta adoración no era la misma que se siente por una hermana, en realidad la deseaba como mujer.
Cuando se da cuenta que la puede perder, se decide a decirle lo que siente en realidad...&nbsp;

